  - name: TEXT4000
    number: '6'
    value: 'Regarding this amended report and the May 6, 2014 RFAI letter from the
      Reports Analysis Division, the original Schedule E entry for the independent
      expenditure mailers against candidate Rodney L Davis inadvertently listed February
      28, 2014 as the dissemination date.  In fact, that was an estimated date of
      last receipt of the mailers by the intended audience.  The actual dissemination
      dates for reporting purposes were February 20 and February 24, when the mailers
      were relinquished to the United States Postal Service.  11 CFR 104.5(g)(4).  Accordingly,
      no 24-hour report was due for this independent expenditure.

